import React from "react";


export class Button extends React.Component {


    render() {
        const { className, onclick, imgAdd, children } = this.props;
        return (
            <button className={"btn-center " + className} onClick={onclick} >
                    <img src={imgAdd} style={{ display: (imgAdd ? "block" : "none"), paddingLeft: "10px", opacity: "70%" }}/>
                    {children}
            </button>
        )
    }
}
